import React, { useState } from "react";
import { TodoData } from "./TodoData";
import '../App.css'; 

function Sidebar() {
    const [activeDescription] = React.useState("Desc");
    
    return (
        <div>
            <h1>TODO List</h1>
            <div className="Sidebar">
                <ul class="SidebarList">
                    {TodoData.map((val, key) => {
                        return <li className="row" key={key} onClick={() => alert('in')}>
                            {val.heading}
                        </li>;
                    })};
                </ul>
            </div>
        </div>
    );
}

export default Sidebar;
